package com.platform.rp.services.employee.external.vo;

import java.io.Serializable;

public class EmployeeInfoVo implements Serializable {
	private static final long serialVersionUID = 1L;
	private int id;
	private long empId;   //打赏金额（评价值）
	private String empName;   //店员名称
	private String empNickName; //店员昵称
	private String jobNumber;   //打赏（评价）时间
	private String headPic; //头像
	
	
	public String getHeadPic() {
		return headPic;
	}


	public void setHeadPic(String headPic) {
		this.headPic = headPic;
	}


	public long getEmpId() {
		return empId;
	}
	
	
	public String getEmpNickName() {
		return empNickName;
	}


	public int getId() {
		return id;
	}


	public void setId(int id) {
		this.id = id;
	}


	public void setEmpNickName(String empNickName) {
		this.empNickName = empNickName;
	}


	public void setEmpId(long empId) {
		this.empId = empId;
	}
	public String getEmpName() {
		return empName;
	}
	public void setEmpName(String empName) {
		this.empName = empName;
	}
	public String getJobNumber() {
		return jobNumber;
	}
	public void setJobNumber(String jobNumber) {
		this.jobNumber = jobNumber;
	}
	
}